import React from "react";
import { useQuery, gql } from "@apollo/client";

const QUERY_ALL_USERS = gql `
    query GetAllUsers {
        users {
            name
            id
            nationality
            username
            friends {
                name
            }
        }
    }
`

function DisplayData() {
    const {data} = useQuery(QUERY_ALL_USERS);

    if (data) {
        console.log(data)
    }

    return <div></div>
}

export default DisplayData
